output_query:
SELECT AVG(Job_Duration_Days) AS Average_Project_Duration 
FROM freelancer_earnings_bd 
WHERE Experience_Level = 'Expert' AND Job_Category = 'Mobile Development';

SELECT AVG(Hourly_Rate) AS Average_Hourly_Rate
FROM freelancer_earnings_bd
WHERE Experience_Level = 'Intermediate' AND Job_Category = 'Web Development';

SELECT AVG(Job_Duration_Days) AS Average_Project_Duration 
FROM freelancer_earnings_bd 
WHERE Experience_Level = 'Intermediate';

SELECT COUNT(Freelancer_ID) AS Number_of_Freelancers
FROM freelancer_earnings_bd
WHERE Job_Category = 'Data Entry';

SELECT COUNT(*) * 100.0 / (SELECT COUNT(*) FROM freelancer_earnings_bd WHERE Experience_Level = 'Expert') AS Expert_Percentage
FROM freelancer_earnings_bd
WHERE Experience_Level = 'Expert' AND Job_Completed < 100;
